$_MODULE['<{upela}default-bootstrap>conf_guide_c5c1bf845c18158a31f3d2dcd4bc72d0'] = '3) Configurez vos transporteurs ';
$_MODULE['<{upela}default-bootstrap>conf_guide_ce90a0a6cb2c9ef9680ec873d036faac'] = 'Dans l’onglet « Transporteurs », choisissez parmi la liste des transporteurs ceux que vous souhaitez afficher sur votre boutique en ligne. Les transporteurs sont classés selon le mode de livraison : Relais, Standard ou Express.';
$_MODULE['<{upela}default-bootstrap>conf_guide_62b6366e3482a64c76982ec85930ef4c'] = 'Cochez ou décochez le transporteur que vous souhaitez activer sur votre boutique dans la colonne « Statut ». Enregistrer votre choix en bas de la page. Cliquez ensuite sur l’icône qui s’affiche dans la colonne « Paramétrer ».';
$_MODULE['<{upela}default-bootstrap>conf_guide_316994649b8378dcaccd950af15a690f'] = 'Les paramètres du transporteur sélectionné s’affichent. Dans l’onglet « 2 Destinations d’expédition et coûts », les tarifs d’expédition s’appliquent automatiquement selon vos paramètres d’expédition par défaut, renseignés dans l’étape 2. •	Pour modifier ces tarifs et la liste des pays destinataires, il vous suffit de cocher ou de décocher les destinations et de renseigner les tarifs que vous souhaitez afficher sur votre boutique.';
$_MODULE['<{upela}default-bootstrap>conf_guide_b3565dd8e3cb2e44a65a67e5e2293718'] = 'Pour modifier ces tarifs et la liste des pays destinataires, il vous suffit de cocher ou de décocher les destinations et de renseigner les tarifs que vous souhaitez afficher sur votre boutique. ';
$_MODULE['<{upela}default-bootstrap>conf_guide_c05f34f40f6d08b9041b60dca4d892cc'] = 'Dans l’onglet « 3 Taille, poids et groupes associés », indiquez les dimensions maximum du colis que vous souhaitez envoyer avec ce transporteur.';
$_MODULE['<{upela}default-bootstrap>conf_guide_c741b85c5e777790cc5cbb2fc5b8e3f7'] = 'Cliquez sur « Terminer » pour finaliser la configuration de votre transporteur.';
